// NavigationMenu.js
import React from 'react';
import { Link } from 'react-router-dom';

const NavigationMenu = ({ onMenuClick }) => {
  const handleMenuClick = (page) => {
    onMenuClick(page);
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <div className="container">
        <Link to="/" className="navbar-brand" onClick={() => handleMenuClick('CryptoToCurrency')}>
          Converter App
        </Link>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <Link to="/" className="nav-link" onClick={() => handleMenuClick('home')}>
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/" className="nav-link" onClick={() => handleMenuClick('about')}>
                About
              </Link>
            </li>
            {/* Add more menu items as needed */}
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default NavigationMenu;
